export function CategoryButtons({setitem, menuCategory})
{
	const buttons = menuCategory.map( (category, key) => 
		<button className="btn-dark text-white p-1 px-2 mx-5 btn fw-bold" key={key}>
			{category}
		</button>);

	return (<div className='d-flex justify-content-center'>{buttons}</div>);
}
